import fetch from 'isomorphic-unfetch';
import clientConfig from '../client-config';


const Index = ( props ) =>{
    console.warn(props);
    return (
       <Layout>
           I am Here with woocommerce 
       </Layout>
    )
};

Index.getInitialProps = async () => {

    const data = await fetch( `${clientConfig}/getProducts` );
    const producsData = await data.json();
}


